INSERT INTO `daftar_pertanyaan` (`id`, `nim`, `nim_kortim`, `wilayah`, `kategori`, `pertanyaan`, `jawaban`, `golongan`, `timestamp`) VALUES
(4, '15.8636', '15.8478', 'Bangka', 5, 'Maaf, kortim saya kenapa ganteng banget ya?', 'Mohon maaf, sepertinya ada kendala di sistem kami', 'khusus', '2018-01-02 14:08:36'),
(5, '14.8168', '14.8168', 'Bangka', 5, 'Ada ruta yang depan rumahnya ada kedai, kedai punya pintu sendiri, luas kedai <10m². Kedai itu dianggap BF sendiri nggak?\r\n', 'tidak dianggap BF karena kurang dari 10m2\r\n', 'umum', '2017-02-22 16:49:13'),
(6, '14.8431', '14.8431', 'Bangka', 5, 'Jadi, di peta wb, batas blok sensus kami cuma sampe jalan raya. Dan itu rt 10. Ternyata, diseberang jalan raya, masih ada rt 10 dan ketua rtnya tinggal disitu. Terus sudah ada tulisan jelas di lapangan, batas sls sampe samping rumah ketua rt. Blok sensus kami jadinya ngikut peta wb atau ditambah yang beberapa rumah yang rt 10?\r\n', 'Sesuai sama peta WB. Ikutin garis hijau nya aja. Karena belum tentu batas SLS itu selalu sama dengan batas BS\r\n', 'umum', '2017-02-22 16:49:21'),
(8, '14.8260', '14.8260', 'Bangka', 5, '[Penegasan INTAMA Day 1 - 1 ] \nHal - hal yang harus diperhatikan dalam penelusuran wilayah', '1. Pastikan arah utara di peta wa dan wb, diharapkan membawa kompas atau aplikasi di handphone \r\n2. Hubungi mitra / ksk untuk meminta izin dan bantuan (boleh warga sekitar yang mengerti lokasi setempat). Ketika bertemu ksk juga sekalian cocokkan peta wa dan wb yang dipunya temen-temen dengan yang terbaru di BPS (tanya ke ksk), hal ini ditujukan untuk mengantisipasi batas -batas yang berubah atau hal lain yg berkaitan dengan batas-batas. \r\n3. Perhatikan batas batas yang ada sedetail mungkin. Dilarang mengubah / menambahkan segmen yang ada. Buat peta wb seinformatif mungkin (dengan menggambar landmark, batas- batas yang jelas, legenda). Untuk landmark di peta wb boleh diperbaiki apabila kurang tepat.\r\n4. Tentukan starting poin ( bf pertama dan ciri-cirinya), barat daya, dan pastikan  batas-batas yang jelas. \r\n5. Perhatikan muatan dan atur strategi untuk listing (misal perkirakan waktu dan beban listing)\r\n6.  Apabila peta wb mempunyai batas-batas yang jelas namun tidak tertulis nomor segmen, maka terlebih dulu *wajib tanya kepada KSK* nomor segmen tersebut. Jika sudah berusaha semaksimal mungkin tanya kepada ksk namun belum mendapat kejelasan, maka *beri nomor sendiri sesuai dengan kaidah yang ada, yaitu mulai dari barat daya ke timur* (ini jika sudah dalam keadaan mendesak). \r\n Lihat contoh gambar di bawah ini. Jika beri nomor sendiri,  a = S010, b =S020, d = S030, c = S040 (gambar 1 = https://pkl56.stis.ac.id/assets/gambar/2002-1.jpeg )\r\n7. Jika peta wb batas2 segmen nya sudah jelas, misal jumlahnya 4, namun jumlah segmen di legenda tertulis 3, maka penomoran segmen disesuaikan dengan gambar segmen di peta, bukan pada tulisan di legenda (gambar 2 : ada 4 segmen seharusnya : https://pkl56.stis.ac.id/assets/gambar/2002-1a.jpeg.)\r\n8. Perkirakan banyak BF BS terkait jumlah stiker (biar ga 2 kali kerja) dan jangan lupa perhatikan gang" kecil terkait kemungkinan lewat cacah\r\n9. Cari tahu karakteristik warga (jam kerja, bisa dicacah kapan, bahasa, etika)\r\n10.  Ketika listing wajib mengisikan alamat secara lengkap. Minimal nama alamat: Nama jalan dan RT/RW (Nama SLS). Jika tidak ada nama jalan, maka wajib beri keterangan tempat, contoh : RT 5/RW 4, ciri-ciri : terletak di depan warung soto bu sri, cat berwarna kuning, berpagar hitam . \r\nContoh yang salah -> \r\nAlamat : Juru Seberang \r\n(Hanya nama kelurahan saja)\r\n11. Penelusuran wilayah harap dilakukan semaksimal mungkin dgn memerhatikan poin poin di atas. \r\n', 'umum', '2017-02-22 02:00:48'),
(14, '14.8207', '14.8207', 'Bangka', 3, 'ini kok progressnya masih 10% utk semua pcl ya?', 'Iya sudah di bahas di grup FAQ dan memang masih ada kesalahan dari server, nanti akan segera diperbaiki. Karena memang pencacahan belum dimulai', 'umum', '2017-02-21 22:31:33'),
(16, '14.8032', '14.7934', 'Bangka', 6, 'test', 'test_lagi_gas', 'khusus', '2017-12-22 03:07:30'),
(18, '14.8203', '14.8203', 'Bangka', 5, 'Bolehkah penelusuran dan listing dilakukan di hari yang sama?', 'Boleh, jika sudah selesai penelusuran wilayahnya dan sudah paham wilayahnya (batas, muatan, ujung barat daya bf pertama, strategi efisien, dst)', 'umum', '2017-02-22 01:45:56'),
(19, '14.8087', '14.8087', 'Bangka', 5, 'Assalamualaykum, izin tanya lg\r\nKalo sampe listing terakhir orgnya gk ketemu kan pake pendekatan tetangga, nah itu rumah yg penghuninya blm dateng tu tetep ditempel stiker?\r\nMisalkan iya, brrt kita nempel stiker tnp izin si penghuni rumah? Eh kalo pake pendekatan tetangga, statusnya berubah dari bstt tdk ditemui jd bstt kah?', ' Waalaikumsalam Wr Wb, kalau misalnya sampai akhir penghuni rumah belum datang, kan tanya tetangga dulu dit, pas pencacahan orangnya udah ada atau belum', 'umum', '2017-02-22 01:42:03'),
(20, '14.7837', '14.8096', 'Bangka', 5, 'Bentuk di WA sama WB nya beda, ambil yg WB ya ? ', 'Iya kak, Patokannya wb ya kaak', 'umum', '2017-02-22 01:42:56'),
(21, '14.8353', '14.8353', 'Bangka', 5, 'mau nanya, kalau kayak gitu (https://pkl56.stis.ac.id/assets/gambar/2102-1.jpeg) mulai listingnya dari yg  segitiga apa lingkaran ?', 'Kalau yang terbarat daya itu dimulainya dari segitiga nag terus baru yang ke arah lingkaran', 'umum', '2017-02-22 02:08:07'),
(22, '14.8337', '14.8337', 'Bangka', 5, 'mau nanya, kalo misal pas listing dan pncacahannya bakal ada pmbantunya doang gmna?\n\nMksdnya pas listing kita udh tau art yg tau ttg rt itu bakal ga ada, kita prlu masukin ke listing ga?', 'karena pembantu nya tidak tau karakteristik ruta itu dan si tuan rumah gak ada yang dirumah satu pun, di capi dibuat bstt tidak ditemui, BF nya tetap digambarkan di peta dan tetap perlu pasang stiker', 'umum', '2017-02-22 06:41:57'),
(23, '14.8102', '14.8102', 'Bangka', 5, 'Kalo bstt campuran ditempelin stiker ?', 'Tetap ditempeli stiker untuk bstt campuran, Yang gak ditempeli stiker itu bsbtt,                        \r\nSEMENTARA bstt tidak ditemui tetap ditempeli stiker', 'umum', '2017-02-22 03:17:51'),
(24, '14.8186', '14.8186', 'Bangka', 5, 'kalo dia ibu kos yg tidak mengurusi kos samasekali kan dia tidak bekerja. berarti kosannya tu ga termasuk usaha gitu?', 'Kasus seperti ini dianggap sementara tidak bekerja , Tapi kos nya itu tetap termasuk berusaha..Maksud mengurusi kos ini termasuk memikirkan, menagih uang kos, mengurusi fasilitas kos, dll di anggap telah melakukan kegiatan bekerja.', 'umum', '2017-02-22 02:11:34'),
(25, '14.8442', '14.8442', 'Bangka', 5, 'Diblok VIII. Point 802 itu kan Jika ada -1 Lanjut ke kolom (3) aja atau (4) jg diisi? . Tidak ada -2 lanjut ke kolom (4) brrti (3) kosong aja kan???', 'Jika ada -1 Lanjut ke kolom (3) Saja\r\nTidak ada -2 Lanjut ke kolom (4) Saja', 'umum', '2017-02-22 02:35:06'),
(26, '14.8442', '14.8442', 'Bangka', 5, 'Blok IV. Point 401 itu klu misal update terbaru ada di bulan januari thn 2017 tapi bukan tgl 1 dan update dithn 2016 itu bulan november. Yg dipakai update januari atau november thn lalu?', 'Pakai tahun 2016', 'umum', '2017-02-22 02:35:06'),
(27, '14.8442', '14.8442', 'Bangka', 5, 'Brrti misal datanya mereka update 2016 awal atau tengah tahun brrti kita patokannya itu tp responden memperkirakan jumlah tambahannya sampai akhir thn kan?', 'podes yg teman2 ambil kedepannya ialah podes berdasarkan mfd bps terbaru berdasarkan pp 16 tahun 2016 yg udah ada dijarkom. jadi ini emang benar2 beda jauh dari frame 2010/lebih tepatnya ga pake 2010 pakenya cuman 2016.  Tolong lihat lampiran di drive yg dikirim di jarkom, semua udah jelas disitu', 'umum', '2017-02-22 02:37:37'),
(28, '14.8143', '14.8178', 'Bangka', 5, 'Konsep  Kos-kosan dalam penentuan art yg orangnya < 10 sama  >10 bagaimana?', 'Tergantung dia makannya gimana \r\na. kalo <10 dianggap ruta biasa dan tetap dimasukan dalam rumah tangga ibu kos\r\nb. >10 dianggap ruta khusus. tidak dimasukan dalam rumah tangga ibu kos', 'umum', '2017-02-22 02:41:03'),
(29, '14.8067', '14.8067', 'Bangka', 5, 'Bolehkah melakukan listing 1 BS langsung bersama-sama seluruh anggota tim?', 'Tidak boleh', 'umum', '2017-02-22 02:40:07'),
(30, '14.8067', '14.8067', 'Bangka', 5, 'Bolehkah listing 1 BS langsung dua orang?', 'Jawab: Listing dalam 1 BS bisa dilakukan oleh 2 orang apabila dua hari terakhir (24 Februari) masih belum ada satupun rumah tangga atau bangunan yang belum dilisting dalam 1 BS tersebut. Sistem pada CAPI, akun yang dipakai melisting BS tersebut ialah pcl yang bertanggung jawab di BS tersebut. Kortim yang membantu bisa membantu menggunakan PAPI, sesuai prosedur yang telah dikatakan pada penegasan listing.', 'umum', '2017-02-22 02:40:07'),
(31, '14.8442', '14.8442', 'Bangka', 5, 'PODES blok VIII. Rincian 802\r\nJika Ada -1 Lanjut ke kolom (3) saja atau (4) juga diisi? \r\nJila Tidak ada -2 lanjut ke kolom (4) berarti (3) kosong saja kan?', 'Jika ada -1 Lanjut ke kolom (3) Saja\r\nTidak ada -2 Lanjut ke kolom (4) Saja', 'umum', '2017-02-22 02:40:36'),
(33, '14.8187', '14.8187', 'Bangka', 5, 'kalo dapur + ruang makan gede terpisah dari bangunan utama itu masuk 1bf 1bsbtt bukan?', 'Jika masih dalam satu penggunaan rumah tangga, maka penghitungannya digabungkan dengan rumah utamanya. Rumah+dapur+ruang makannya diberi nomor 1 BF dan 1 BS', 'umum', '2017-02-22 03:15:00'),
(34, '14.8176', '14.8113', 'Bangka', 5, 'Jika di suatu sekolah terdapat penjaga yang tingga di sekolah tersebut berapa BF dan BS?', 'Sekolah Dasar Negeri 06 dan salah satu bagian dari bangunannya digunakan sebagai tempat tinggal, maka dianggap satu bangunan fisik dua bangunan sensus (buped hal 40) dengan kata lain kalau dalam satu pekarangan sekolah itu ada rumah bapak penjaga sekolah, maka dihitung 1 bf 2 bs (1 bsbtt untuk sekolah, 1 bstt untuk rumah bapak penjaga sekolah kalau tidak ada tinggal di sekolah, maka dihitung 1 bf 1 bs.', 'umum', '2017-02-22 04:04:53'),
(35, '14.8256', '14.8256', 'Bangka', 5, 'mau tanya jika mulai dari segmen 1 (kanan bawah) tp listing dari barat daya?', 'Listing tetap dari arah barat daya meskipun arah barat daya meskipun segmen terbarat daya tidak berkode S010. Pastikan sudah menghadap utara', 'umum', '2017-02-22 16:49:30'),
(37, '14.8427', '14.8427', 'Bangka', 5, 'batas segmen peta wb ternyata jalan buntu/tidak diakui jln oleh warga. gmn menentukan bts sgmn?', 'batas segmen adalah batas yang memotong dan membagi habis wilayah BS, jadi silakan sesuaikan dengan peta nya', 'umum', '2017-02-22 05:57:20'),
(39, '14.8260', '14.8260', 'Bangka', 5, '[Penegasan INTAMA Day 3 - 1]\r\n', '1.	Yang perlu ditempel stiker dan nomor ruta tetap dimasukan dalam capi:\r\na.	BSTT dapat ditemui \r\nb.	BSTT tidak dapat ditemui \r\nYang tidak perlu ditempel stiker, namun NOMOR BF DAN BS tetap dimasukan dalam capi :\r\na.	BSBTT \r\n2.	Jika suatu bangunan didingnya kuang dari 4 sisi, maka perhatikan beberapa hal berikut ini :\r\na.	Jika banguna tersebut digunakan untuk tempat tinggal, maka dianggap 1 BF (untuk ukuran yang kurang atau lebih dari 10m2)\r\nb.	Jika bangunan tersebut digunakan untuk usaha/ aktivitas lainnya, maka tidak dianggap BF (untuk ukurang yang kurang atau lebih dari 10m2)\r\n3.	Apabila rumah yang sedang dibangun dan akan ditempati, apakah BSTT atau BSBTT?\r\nTanyakan apakah akan ditempati atau tidak. jika akan ditempati sebelum 2 maret, maka pada listing dimasukkan dalam bstt. jika belum ditempati sampai tanggal 2 maret, maka pada listing dimasukkan dalam bsbtt dengan keterangan jenis bangunan rumah kosong.\r\n4. Bila menanyakan tentang peta harap lampirkan foto petanya', 'umum', '2017-02-22 05:59:47'),
(40, '14.8221', '14.8240', 'Bangka', 5, 'Kalo misal salah listing terus merubah yang di CAPI. Apa nanti harus merubah tempelan stiker?', 'Stiker juga harus diubah.', 'umum', '2017-02-22 16:49:38'),
(41, '14.8005', '14.8268', 'Bangka', 5, 'kalo dia cuma tinggal sementara (nggak sampe 6 bulan ) nggak usah di listing kan?', 'ngga usah', 'khusus', '2017-02-22 23:23:02'),
(42, '14.8119', '14.8119', 'Bangka', 6, 'kalau hujan lebih baik pakai capi atau papi? ', 'kalo bisa capi, tapi kalau takut tab nya rusak dll bisa menggunakan papi lalu di input ke capi', 'umum', '2017-12-22 03:07:30'),
(43, '14.8137', '14.8310', 'Bangka', 6, 'Batas RT dilapangan acak, tdk garis spt WB, kita mau membuat garis lurus u/ memotong BS, how?', '', 'khusus', '2017-12-22 03:06:37'),
(45, '14.7973', '14.8117', 'Bangka', 5, 'rahmaa... adA 3ruta di satu rumah.. gimana listingnya..?', 'listing satu2', 'khusus', '2017-02-23 06:46:47'),
(46, '14.8117', '14.8117', 'Bangka', 5, 'di dpn rmh rsponden ada rmh ksg, rmh ksg ini fs.nya sbg jemuran gmn ? Bsbtt ?', 'BSBTT dilihat dulu ukurannya, sama dengan atau lebih dari 10 meter persegi, maka 1 BF 1 BS, BSnya BSBTT.', 'umum', '2017-02-22 16:49:55'),
(47, '14.8093', '14.8093', 'Bangka', 5, 'salah satu bs tidak jelas baik sls maupun batas, kata mitra itu sdh gak berlaku WBnya, bgaimna?', 'Tetap gunakan peta wb 2010, tetapi tanyakan lagi kepada sls batas yang ada di peta wb yang kamu pegang itu sekarang keberadaan batasnya bagaimana.', 'umum', '2017-02-22 09:53:21'),
(48, '14.8206', '14.8206', 'Bangka', 6, 'Bangunan punya atap,dinding,dan lantai.Tapi dindingnya stngah. masuk BF? ', 'Jika tinggi dinding lebih dari setengah tinggi bangunan dan terdapat dinding di keempat sisi, maka menjadi bangunan fisik (Buped halaman 61, Konsep atap dan dinding)', 'umum', '2017-12-22 03:07:30'),
(49, '14.8287', '14.8017', 'Bangka', 5, 'ruta bru sebulan tggl dsni, tp gatau akan tggl brp lama, jd gmn? apakah ttp d catat?', 'tanyakan lagi pada ruta tersebut apakah sampai tanggal 2 maret masih tetap tinggal disitu atau tidak\r\nkalau misalkan masih ada sampai tanggal 2 maret maka tetap dilisting\r\n', 'umum', '2017-02-23 13:54:34'),
(50, '14.8119', '14.8119', 'Bangka', 5, 'kalau slsnya itu rt, lalu rumah tangga yang tercakup itu batas rt atau kk yang masuk rt itu? ', 'Maaf, pertanyaan tidak jelas. mohon kirim yang lebih jelas.', 'umum', '2017-02-22 09:50:53'),
(51, '14.8207', '14.8207', 'Bangka', 6, 'semua bangunan fisik yg ada, digambar semua di peta wb? kl ada 160 bf, semua digambar kecil2 y?', 'Benar. Jadi seluruh BF digambar di peta WB. Jika, kawasannya pemukiman padat penduduk maka gambarnya di peta WB nya disesuaikan ukurannya.', 'umum', '2017-12-22 03:07:30'),
(52, '14.8206', '14.8206', 'Bangka', 6, 'jika warga tdk tau nmor RW baru,stiker yg ditulis dgn RW lama perlu diubah?', 'Sesuaikan dengan kondisi sebenarnya, tolong diubah ya gengs. Semangat ^^', 'umum', '2017-12-22 03:07:30'),
(53, '14.8436', '14.8422', 'Bangka', 3, 'apa ini', '', 'khusus', '2017-02-22 09:39:00'),
(54, '14.8293', '14.8253', 'Bangka', 5, 'jika ada rumah yang jualannya didalam rumah dengan bantuan meja saja. itu BSTT atau campuran ?', 'campuran', 'umum', '2017-02-22 09:45:36'),
(55, '14.8117', '14.8117', 'Bangka', 5, 'paling barat daya itu rmh baru blm ditempati brrti ruta no. 1 rmh terdekat plg brt daya kan', 'Penentuan bangunan pertama tidak selalu BSTT ya, yang penting Bangunan pertama terujung barat daya adalah bangunan fisik ', 'umum', '2017-02-22 09:46:32'),
(56, '14.8293', '14.8253', 'Bangka', 5, 'jika sejenis meja di luar rumah buat jualan ? BSTT atau campuran ?', 'campuran', 'khusus', '2017-02-22 09:55:11'),
(57, '14.8237', '14.8126', 'Bangka', 5, 'kalau misalnya ada usaha menjahit dalam rumah nnti itu msk bstt campuran juga ga? ', '', 'khusus', '2017-02-22 10:03:22'),
(58, '14.8237', '14.8126', 'Bangka', 5, 'klo garasi yg tdk satu atap dan dindingnya dr semen itu 1 bf 1 bs ga?', '', 'khusus', '2017-02-22 10:05:49'),
(59, '14.8093', '14.8093', 'Bangka', 6, 'sls bilang petanya salah total, batas2 di peta jg slah total, sls gak bisa bantu, bagaimana?', 'Coba hubungi ksk atau penelusuran wilayah sendiri dulu, barangkali nanti ketemu batas2 yang jelasnya', 'umum', '2017-12-22 03:07:30'),
(60, '14.8011', '14.8253', 'Bangka', 6, 'salah masukin. . . bs yg sebenarnya ku data 009b tapi aku masukin 007b. di stiker juga 009b ', 'untuk stiker diperbaiki dengan yang benar.  coba bilang di FAQ CAPI untuk perbaikan bisa atau tidak dari server. kalau tidak bisa, maka bisa diedit sendiri.', 'umum', '2017-12-22 03:07:30'),
(61, '14.8119', '14.8119', 'Bangka', 5, 'Oh iya, rumah kosong itu bsbtt atau bstt td?', 'Kalau sudah dipastikan benar-benar tidak ada ruta yang tinggal di rumah tersebut maka, dikategorikan BSBTT.', 'umum', '2017-02-22 10:55:12'),
(62, '14.8011', '14.8253', 'Bangka', 6, 'bs yg sebenarnya di data 009b aku masukin ke 007b ... gimana ?', 'Kirimkan detail permasalahannya ke Luqman ( 085312950813 )', 'umum', '2017-12-22 03:07:30'),
(63, '14.8427', '14.8427', 'Bangka', 6, 'ada bf banyak bstt campuran, stiker di pasang di yg terlihat kan? meskipun dia bsbtt?', 'Yang dipasang stiker ialah bstt, bstt campuran dan bstt tidak ditemui. Untuk bsbtt tidak dipasang stiker. Striker dipasang di tempat yang strategis dan mudah untuk dilihat dari luar. ', 'umum', '2017-12-22 03:07:30'),
