(85, '14.8399', '14.8399', 'Bangka', 6, 'izin bertanya kalau satu BS itu satu segmen, jadi meskipun ada jalan yang memisahkan atau hutan atau apa, kita listingnya tetep jalan ke arah timur mskipun harus nyebrang jalan?', 'tolong kirimkan gambar ke salah satu intama.', 'umum', '2017-12-22 03:07:30'),
