(89, '14.8095', '14.8168', 'Bangka', 5, 'Jika ada ruta yang sedang pergi keluar kota dan kembali di luar waktu pencacahan, tetapi memiliki informasi dari tetangga, dimasukkan BSTT atau BSTT Tidak Ditemui?', 'ketika diluar waktu pencacahan sampai tangga 2 maret maka dia Bsbtt', 'khusus', '2017-02-25 02:10:06'),
(90, '14.8387', '14.8387', 'Bangka', 6, 'dear sahabat, jjadi misal dia rumahnya susun. yang bawah dia ditinggali, yang atas dia warung tapi dindingnya kurang dari 4 sisi. itu gimana ya nentuin bs dan bf nya? mohon pencerahan ', 'Yang dikatakan rumah susun bukannya gabungan dari beberapa petak kamar yang berada dalam satu gedung. Kalau seperti yang saudara katakan, bagaimana bisa warung ada di rumah susun?? mohon diperjelas pertanyaannya', 'umum', '2017-12-22 03:07:30'),
