(92, '14.8399', '14.8399', 'Bangka', 6, 'kalau utara nya wa dan wb beda2 dikit (menceng2 dikit), ikut yang mana ya?', 'Pastikan saat penelusuran wilayah arah utara sebenarnya itu arahnya dimana.\r\nApabila ada kesalahan arah utara maka diperbaiki dan disesuaikan dengan keadaan yang sebenarnya', 'umum', '2017-12-22 03:07:30'),
(94, '14.8035', '14.8035', 'Bangka', 6, 'untuk rw misal ada beda wb sama aslinya, yg ditulis dan diinput yg baru atau lama? trus kalau misal ternyata yg dipake yg baru, trus udah terlanjur gmn?', 'Terimakasih atas pertanyaannya. menggunakan alamat sls yang baru. Apabila sudah terlanjur, maka perbaik alamat sls yang lama dengan yang baru pada CAPI dan stiker. ', 'umum', '2017-12-22 03:07:30'),
(95, '14.8182', '14.8182', 'Bangka', 6, 'misalkan ada 2 bangunan, A B. Terus B itu cm ada kakek nenek, dan itu makannya di rumah A. Itu tuh B dijadiin bsbtt?', 'Kasus ini termasuk 2BF 2BS dan 1 ruta\r\nRumah ibu masuk BSTT dan rumah nenek masuk BSBTT', 'umum', '2017-12-22 03:07:30'),
(97, '14.8230', '14.8230', 'Bangka', 6, 'perlukah kami meminta izin jika kita ingin membantu listing teman dalam 1 bs?', 'jika yang dimaksud kepada Intama, tidak perlu, namun harus mengikuti peraturan yang ada di penegasan listing.', 'umum', '2017-12-22 03:07:30'),
(99, '14.8023', '14.8230', 'Bangka', 5, 'jika ada gudang di depan rumah tapi beda atap dan beda tembok,tapi dia jarang dibuka sama pemiliknya, itu brp bf brp bs?', 'Perlu ditekankan, gudang yang ada di depan rumah dipergunakan untuk keperluan rumah tangga tersebut atau tidak, apabila iya, maka lihat ukuran gudang jika ukurannya besar sama dengan 10 meter kuadrat maka gudang dihitung 1 BF, sedangkan kalau ukurannya kurang dari 10 meter kuadrat, maka gudang dihitung bukan BF (gudang dan rumah dihitung 1 BF) apabila gudang tidak digunakan untuk keperluan rumah tangga tersebut maka juga disesuaikan lagi ukurannya, jika besar sama 10 meter kuadrat di anggap satu BF, jika tidak dianggap bukan BF. ', 'umum', '2017-02-22 16:42:43'),
(100, '14.7934', '14.7934', 'Bangka', 5, 'bolehkah memberi penomoran interval ruta di peta wb, karena space segmen tidak mencukupi?', 'Yang diberi penomoran pada peta WB yaitu seluruh BF yang ada. Penomoran dilakukan untuk setiap kotak(BF) bukan berdasarkan ruta nya.', 'umum', '2017-02-22 16:43:00'),
