(104, '14.8027', '14.8027', 'Bangka', 6, 'rumah yang sedang dibangun namun sudah ada lantai, atap, dinding tapi belum ada pintu, dan berencana ingin ditinggali tapi tidak tahu kapan, masuk bstt atau tidak?', 'Mohon dicari kepastian akan ditinggali apakah sebelum hari terakhir pencacahan atau setelah. Jika sampai tanggal 2 belum ditinggali masuk bsbtt', 'umum', '2017-12-22 03:07:30'),
(105, '14.8168', '14.8168', 'Bangka', 6, 'rumah yg sementara tidak ditempati karena sedang mencari pembeli atau penyewa bagaimana?', 'Termasuk kategori BSBTT', 'umum', '2017-12-22 03:07:30'),
(106, '14.8427', '14.8427', 'Bangka', 6, 'kalo salah stiker, tempel ulang atau coret? lebih dari 1 soalnya :"', 'Stiker jika dilepas pasti tidak cukup karena stiker yang terbatas, mohon fikirkan cara terbaik seperti diberi minyak angin atau balsem atau pakai bensin motor. Sesuaikan dengan kreativitas saudara', 'umum', '2017-12-22 03:07:30'),
(107, '14.8427', '14.8427', 'Bangka', 6, 'penulisan alamat bagaiman ya bakunya? apakah tiap alamt ditulis beserta ciri2 tempatnya atau hanya bf pertama?', 'Semua alamat harus lengkap seperti jalan.. jika tidak ada jalan baru di deskripsikan beberapa yang tidak jelas intinya untuk memudahkan dalam memahami alamat', 'umum', '2017-12-22 03:07:30'),
(108, '14.8313', '14.8313', 'Bangka', 6, 'ini kenapa bs dan ruta saya masih kosong? ', 'Sudah ada di server kok datanya. Silakan lakukan sync di daftar BS (bukan daftar rutanya). Dan pastikan di PCL sudah ada datanya, karena di server sudah masuk', 'umum', '2017-12-22 03:07:30'),
(109, '14.8163', '14.8355', 'Bangka', 1, 'kalau di pom bensin, ada yang selalu tidur di sana setiap malam. tapi cuma malam aja. itu tetap jadi 1 bf 2 bs atau 1 bf 1 bs aja?', '', 'khusus', '2017-02-23 01:37:59'),
(110, '14.7957', '14.7957', 'Bangka', 1, 'kontrakan berpenghuni 2 orang makan sendiri sendiri. berapa ruta? krtnya siapa?', 'Rutanya jadinya 1. Krt nya adalah yang dianggap di ruta tersebut', 'umum', '2017-02-23 02:40:37'),
(111, '14.7964', '14.7964', 'Bangka', 5, 'blok sensusku suds ku listing terdiri dari 98 bsbtt dan 2 bst. it gimana', 'sudah pastikan itu benar sesuai batas dalam peta wb? sudah dipastikan tidak ada yang lewat cacah? jika sudah benar, finalisasi', 'umum', '2017-02-23 02:40:20'),
(112, '14.7943', '14.8248', 'Bangka', 5, 'ada kasus 1 rumah, 1 nenek, trus sumber pendapatannya dari anak2nya, masak sendiri, itu karuta nya siapa?', 'Yang menjadi KRT nenek itu sendiri.', 'khusus', '2017-02-23 06:25:11'),
(114, '14.8310', '14.8310', 'Bangka', 1, '2 kluarga, bda rmah, mkan 1 pngelolaan. Isi BF & BSnya sprti biasa atau ada perlakuan lain?', 'Apakah sumber uang dalam pengelolaan makanan hanya satu? Jika ya, maka isikan 2BF, 2BS, 1ruta. 1BF yang dihuni KRT dianggap 1 BSTT dan BF lainnya menjadi BSBTT.', 'umum', '2017-02-23 03:13:58'),
(115, '14.8181', '14.8087', 'Bangka', 1, 'slmt pagi, mau tanya saya listing kalo ada 1 rumh penglolaan mknn sendri2 jdiny di capi input 2 x dengn no bf dan no bs yg sama? jadi yg satu kakek nenk tpi buat mknnny sndri , yg satu suami isrti 2 anak buat mknn sendr..jdi no bf dan bs ny sama?', '', 'khusus', '2017-02-23 02:49:35'),
