(285, '14.8101', '14.8101', 'Bangka', 1, 'di sp 2010 rumah ikut blok 018b,  di se2016 rumah ybs ikut blok 005b, kita harus ikut yang mana? tp di peta wb rumah itu harusnya blok 005b', 'ikut peta wb mu aja. jadinya blok 005b', 'khusus', '2017-02-25 02:13:42'),
