(417, '14.8035', '14.8035', 'Bangka', 5, 'iuran BPJS kelas 2 itu brp ya perbulannya?', 'Per april 2016\r\n\r\nKelas 1	Rp80.000\r\nKelas 2	Rp51.000\r\nKelas 3	Rp25.500', 'umum', '2017-02-26 23:48:57'),
