(419, '14.8432', '14.8432', 'Bangka', 5, 'pekerjaan seminggu yg lalu berkebun. pekerjaan biasanya sebelumnya tambang timah. untuk pendapatan bagaimana? berkebun panennya 2 tahun dan belum ada panen. kalau pendapatan per bulan bagaimana? 0?', 'Pendapatan sebulan yang lalu mencakup :\r\n- pendapatan seminggu lalu berkebun\r\n- pendapatan menambang timah satu bulan yang lalu (hanya yg masuk time reference : 26 jan-25feb)\r\n\r\nUntuk pendapatan berkebun (sektor pertanian), didekati dgn hasil panen setahun yg lalu (berapa hasilnya) kmudian dibagi 12', 'umum', '2017-02-26 23:46:23'),
(420, '14.8073', '14.8092', 'Bangka', 1, 'kalau ibu2 tiap bulan dapat transfer pendapatan dari lahan sawitnya yg dikelola perusahaan dan besarannya tiap bulan beda2 itu masuk berusaha tidak ya? kalau iya sektor apa? ', '', 'khusus', '2017-02-27 06:32:07'),
(422, '14.8437', '14.8437', 'Bangka', 3, 'haloo jalu semangat yak!  <3', 'Makasih <3', 'khusus', '2017-02-27 02:41:51'),
(423, '14.8092', '14.8092', 'Bangka', 2, 'kalau responden mengaku g pernah bayar pajak gimana ya?', 'probing terkebih dahulu, jika memang sudah maksimal, tidak apa-apa tidak dimasukan. ', 'khusus', '2017-02-27 02:37:34'),
(424, '14.8035', '14.8035', 'Bangka', 5, 'kalau pekerja keluarga harus ada upah ya? soalnya di rule validasinya kalau diisi 0 jadi ada errornya', 'Diisi 1 ya.', 'umum', '2017-02-27 00:35:30'),
(425, '14.8117', '14.8117', 'Bangka', 5, 'ART Resp. ada yg bekerja sbg pengajar kursus kecantikan, kira2 lap usahanya apa ? di SPK Online kursus kecantikan tidak ada ', 'masuk sektor pendidikan', 'khusus', '2017-02-27 01:26:54'),
(426, '14.8117', '14.8117', 'Bangka', 5, 'ART Resp. ada yg bekerja sbg pengajar kursus kecantikan, kira2 lap usahanya apa ? di SPK Online kursus kecantikan tidak ada ', 'Masuk ke pendidikan..\r\n\r\nKlasifikasi kbli, sesuaikan tempat bekerjanya juga yaa', 'khusus', '2017-02-27 01:09:29'),
(427, '14.8117', '14.8117', 'Bangka', 5, 'ART Resp. ada yg bekerja sbg pengajar kursus kecantikan, kira2 lap usahanya apa ? di SPK Online kursus kecantikan tidak ada ', 'Sesuaikan tempat bekerjanya ya :)\r\nApabila dia bekerja dibawah agensi tenaga pendidik, masuk di sektor pendidikan', 'umum', '2017-02-27 01:04:47'),
(428, '14.8006', '14.8006', 'Bangka', 3, 'Kalo kuesioner di hapus kuesioner ada 3, tapi di ubah kuesioner cm ada 1 . Itu kenapa?', 'Itu di hapus kuesioner memang seluruh kuesioenr yang pernah dibuat di device itu (termasuk yang sudah di kirim), sedangkan untuk yang di ubah kuesioner itu yang belum terkirim', 'umum', '2017-02-27 02:42:42'),
(429, '14.8036', '14.8119', 'Bangka', 6, 'blokXI.2 biaya produksi 240k, nilai produksi 0, gagal panen, validasi error??', '', 'khusus', '2017-12-22 03:07:30'),
(430, '14.8253', '14.8253', 'Bangka', 2, 'rumah msh dibikin belum jadi imputasi gak? dia sementara tinggal di kontrakan', 'Rumah yang masih dibangun dan belum jadi tidak perlu diimputasi. Rumah tempat dia mengontrak masuk dalam pengeluaran non makanan bagian sewa, kontrak, perkiraan sewa rumah.', 'khusus', '2017-02-27 02:31:56'),
(431, '14.8310', '14.8310', 'Bangka', 2, 'Ada ruta yg berprofesi sbg pengurus partai, dia menolak untuk ditanya pendapatan dari partai tsb. Ini bagaimana u/ menghadapinya???', 'Jelaskan maksud dan tujuan PKL ini sebaik mungkin, gali juga pendapatan selain dari pendapatan mengurus partai tersebut.', 'khusus', '2017-02-27 06:40:14'),
(432, '14.8222', '14.8222', 'Bangka', 2, '(need fast respon) buruh pekerja keluarga / tidak di bayar. dia tidak di gaji tidak di upah. tapi kenapa validasinya harus memiliki upah jadinya gak bisa ', 'tulis "1" ya. di penegasan sudah ada', 'khusus', '2017-02-27 02:50:00'),
(434, '14.8344', '14.7981', 'Bangka', 6, 'ndre aku udah dapet 2 trus hpku belum jadi masih masalah ini aku lanjut lagi yaaa', 'oh okeee mantapppp pak yudha. dari 2 itu nama krtnya siapa aja?', 'khusus', '2017-12-22 03:07:30'),
(435, '14.8126', '14.8126', 'Bangka', 5, 'Respondenku ada yg kelaut baru brangkat td malam dan biasanya 4 hari gimana?', 'lakukan wawancara pada art lainnya yang mengetahui karakteristik yang ditanyakan pada kuesioner', 'umum', '2017-02-27 05:32:10'),
(436, '14.8126', '14.8126', 'Bangka', 5, 'Respondenku ada yg kelaut baru brangkat td malam dan biasanya 4 hari gimana?', 'Apakah hanya KRTnya yang melaut? Apakah rumahnya benar-benar kosong?', 'khusus', '2017-02-27 05:16:54'),
(437, '14.8344', '14.7981', 'Bangka', 6, 'aku baru dimasjid al fallah sinarmanik mau istirahat sholat bentar. hpku belum jadi katanya sekarang udah dapet 4 ruta namanya fatah, maryamto, trimo, william harris ', 'udah makan blm yud? eka di rumah makan yg depan polsek itu, lg nyacah ibu yg punya. kalo blm makan, makan dlu', 'khusus', '2017-12-22 03:07:30'),
(442, '14.8299', '14.8207', 'Bangka', 2, 'kalau responden yg mau dicacah sedang tidak ada dikontrakan selama 2 minggu kedepan karna menikah. dan dia sendirian gimana ya? apakah jadi non respon?', 'Diusahakan untuk dicacah yaa sampai hari terakhir pencacahan lakukan revisit', 'umum', '2017-02-28 01:11:44'),
(443, '14.8310', '14.8310', 'Bangka', 5, '[Blok XII rincian 11] Jika ada ruta yg membeli air dari pedagang keliling (yg menggunakan jurigen), itu masuk kategori apa ya? Lainnya?', 'ledeng eceran', 'umum', '2017-02-27 07:08:18'),
(445, '14.8126', '14.8126', 'Bangka', 2, 'kalo berobat k dokter buat periksa dan itu cuma sekali ga bolak balik kontrol gtu masuk rawat jalan ga?', 'Termasuk rawat jalan ^^', 'khusus', '2017-02-27 07:51:46'),
(446, '14.7981', '14.7981', 'Bangka', 5, 'Kalo dalam ruta tidak ada yg sekolah, terus pertanyaan ttg kecukupan finansial untuk kebutuhan pendidikan diisi apa?', 'Apabila rumah tangga tidak mengeluarkan biaya untuk salah satu rincian pertanyaan, PCL memilih jawaban dengan kata â€˜Tidakâ€™ dan Wajib Menuliskan Keterangan Responden Pada Catatan', 'khusus', '2017-02-27 08:30:34'),
(447, '14.8344', '14.7981', 'Bangka', 6, 'udah ndre woles udah dapet 5 nih ntar aku kelarin bs ku lah yaa kurang 2 ruta nih', 'okee yud, lanjutkan. tadi siapa namanya yg terakhir dicacah?', 'khusus', '2017-12-22 03:07:30'),
(449, '14.8253', '14.8253', 'Bangka', 2, 'bayi umur 6 hari belum.dikasih nama gimana?', 'Tanyakan responden perkiraan namanya', 'khusus', '2017-02-27 08:58:28'),
(454, '14.8253', '14.8253', 'Bangka', 2, 'maksain banget sih nanyain nama bayi baru lahir wkwk', 'yang penting ada namanya ajalah au:) di tabulasi gak penting kok. selamat mengawasi pcl au, yang fokus. jangan banyak2 ngelawak', 'khusus', '2017-02-27 09:09:59'),
(455, '14.8126', '14.8126', 'Bangka', 6, 'timku dapet sampel yang isinya 15 art d capi maks 10 art nah prosedur nyacahnya gimana,? timku dapet 15 art', 'sementara pake papi, catatannya kuesioner papi nya dijaga baik2, terus nanti di jakarta yg art > 10 dikumpulkan buat nyalin pake kuesioner yg bisa buat > 10 art', 'umum', '2017-12-22 03:07:30'),
(458, '14.8126', '14.8126', 'Bangka', 5, 'krt ini punya perahu Di pakai buat melaut sama orang, dan di fokuskan oleh ruta itu juga usaha nelayan ini, itu masuk k usaha kan? terus buat jam kerjanya gimana?', 'tolong dijelasin lebih rinci masalahnya\r\nsoalnya masih ambigu', 'khusus', '2017-02-27 10:11:08'),
(459, '14.8427', '14.8427', 'Bangka', 2, 'satu keping tahu berapa kilo ya?', '0,05 kg', 'khusus', '2017-02-27 10:04:37'),
(462, '14.8427', '14.8427', 'Bangka', 2, 'kartu indonesia sehat/kis itu masukknya jenis apa ya? ada yg dia membayar ada yg tidak. apakah kis dapat disamakan dg bpjs?', 'KIS tidak ada yang membayar. Apakah itu benar KIS atau BPJS Mandiri?', 'khusus', '2017-02-27 10:18:04'),
(463, '14.8427', '14.8427', 'Bangka', 2, 'sudah diprobing dan memang responden menfatakan bahwa mempunyai kis dan bayar dg potong gaji. percaya responden atau yg lain? kalo percaya masuk yg mana ya?', 'Maaf, setahu saya KIS itu tidak berbayar, apalagi dipotong gaji:( Jika responden tetap yakin bahwa itu KIS, isikan di Lainnya, tuliskan ''KIS Berbayar''', 'khusus', '2017-02-27 10:31:23'),
(464, '14.8248', '14.8248', 'Bangka', 5, 'askes lama yg blm ditukarkan masuk bpjs kesehatan atau tidak bos? kalo buped,askesnya cuma untuk bpjs penerima upah, mohon pencerahanny, terimakasih', 'Jika masih bisa digunakan untuk berobat, bisa dimasukkan dalam bpjs. Untuk penentuan jenis bpjsnya sendiri bisa digolongkan menjadi bpjs kesehatan jika memang bukan bpjs ppu. Terima kasih', 'khusus', '2017-02-27 13:21:28'),
(469, '14.8092', '14.8092', 'Bangka', 2, 'aksa mandiri itu masuk jaminan apa untuk keperluan berobat? aku masukin ke lainnya dulu', 'Jika memang bisa untuk berobat, masukkan lainnya tidak apa, jangan lupa tuliskan Axa mandiri. Terima kasih', 'khusus', '2017-02-27 13:18:27'),
(470, '14.7949', '14.8222', 'Bangka', 3, 'kuesioner diupload tapi tidak ada notifikasi', '', 'khusus', '2017-02-27 12:47:16'),
(471, '14.8006', '14.8006', 'Bangka', 5, 'anak >5tahun masih tk ditulis apa yaa? maaf lupa', 'Iyaa masih bisa di tulis di pra sekolah. Soalnya umur untuk pra sekolah itu antara 0-6 th', 'khusus', '2017-02-27 13:23:22'),
(472, '14.8006', '14.8006', 'Bangka', 5, 'masih >6 tahun, masih tk, tulis apaa? ', 'Pada rincian 504 tuliskan tidak atau belum pernah sekolah', 'khusus', '2017-02-28 01:55:05'),
(473, '14.8006', '14.8006', 'Bangka', 5, 'masih >6 tahun, masih tk, tulis apaa? ', 'Tetap masukkan ke pra sekolah\r\nLalu di bagian bersekolah tulis belum bersekolah', 'umum', '2017-02-27 23:55:01'),
(474, '14.8345', '14.8345', 'Bangka', 5, 'kalau responden benar2 tidak tahu besarnya dana BOS. Solusinya?', 'Diinputkan beasiswa/bantuan setahunya saja dan tetap tulis di catatan bahwa responden tdk tahu besaran bos\r\nNnti akan diusahakan di skpd', 'khusus', '2017-02-27 23:52:41'),
(475, '14.8112', '14.8203', 'Bangka', 5, 'seseorang dengan pekerjaan utama tukang cuci, tiap bulan mencuci untuk 3 ruta (A,B,C). Setiap bulan mendapat upah dari ketiga ruta tsb 300rb dr tiap ruta. Status pekerjaan termasuk berusaha sendiri atau sbg buruh? ', 'Buruh (pekerja bebas karena memiliki lebih dari 1 majikan dalam satu bulan)', 'umum', '2017-02-27 23:56:30'),
(476, '14.8437', '14.8437', 'Bangka', 5, 'Biasanya bekerja tambang tapi 1minggu yg lalu mesin rusak trus kerja kebon,  pkrjaan utama apa? ', 'jadi waktu terbanyak yg digunakan untuk bekerja dalam seminngu yg lalu itu kebun kan ?\r\nitulah yg jadi pekerjaan utama', 'khusus', '2017-02-28 00:45:03'),
(477, '14.8340', '14.8168', 'Bangka', 5, 'jika ruta memiliki usaha warung nasi, dan konsumsi ruta tsb digabung dengan masakan yang akan dijual, bagaimana mengisi modul konsumsinya?', 'dikira kira berapa yang di konsumsi rumah tangga tersebut diluar yang di warung, jadi harus diinputasi', 'umum', '2017-02-28 00:52:51'),
(478, '13.7480', '13.7480', 'Bangka', 6, 'rantai motor kendor, lampu mati, di bengkel deket sini (membalong, kembiri) sparepart ga ada, info bengkel honda / ahass di belitung ya, beserta jam buka tutup nya', 'Jalan Sriwijaya No.123A, Tanjung Pandan, Tj. Pandan, Kabupaten Belitung, Kepulauan Bangka Belitung 33411, Indonesia', 'umum', '2017-12-22 03:07:30'),
(479, '14.8203', '14.8203', 'Bangka', 2, 'Kalau responden menolak gimana? udah didatangi 2 kali dan tetap menolak', 'usahakan sampai terakhir pencacahan tetap di coba ya. :) fokus yang lain dulu ya.', 'khusus', '2017-02-28 03:15:40');
INSERT INTO `daftar_pertanyaan` (`id`, `nim`, `nim_kortim`, `wilayah`, `kategori`, `pertanyaan`, `jawaban`, `golongan`, `timestamp`) VALUES
(480, '14.8178', '14.8178', 'Bangka', 5, 'untuk bunga deviden , jika responden tidak tahu brapa bunga yg diperoleh, itu bagaimana ?', 'Jika responden tidak tahu bunga yang didapat, probing lebih lanjut untuk mengetahui jumlah tabungannya. Tanyakan responden menabung di bank mana. Selanjutnya bisa dilihat suku bunga di lampiran buku pedoman pencacahan. Kalikan tabungan dengan suku bunga bank. Terima kasih', 'khusus', '2017-02-28 02:58:16'),
(481, '14.7964', '14.7964', 'Bangka', 5, ' kalau ga ada orang yg sekolah persepsi biaya kebutuhan pendidikan diisi apa ya?', 'Pilih kurang cukup. Tulis keterangan tidak terdapat ART yang bersekolah.', 'khusus', '2017-02-28 04:04:44'),
(482, '14.7964', '14.7964', 'Bangka', 5, ' kalau ga ada orang yg sekolah persepsi biaya kebutuhan pendidikan diisi apa ya?', 'kurang dari cukup. dan dituliskan di catatan gak ada yang sekolah', 'khusus', '2017-02-28 03:50:20'),
(484, '14.8099', '14.7981', 'Bangka', 6, 'ku udah kelar 2 ndre sekarang bingung sinar manik udah nggak ada lagi yang bisa ditanyai pada kosong rumahnyaaa. aku sama eka ke telak atau gimana ini?', 'ke penginapan sini, aku anter ke telak', 'khusus', '2017-12-22 03:07:30'),
(486, '14.8310', '14.8310', 'Bangka', 2, 'Apakah kortim bisa mendownload ulang kuesioner dari PCL (monitoring), kuesioner yg didownload akan terduplicate atau tidak?', 'tidak akan terduplikasi, yang kalian periksa pasti yang kalian bisa download dari menu monitoring', 'umum', '2017-03-01 03:17:52'),
(487, '14.8285', '14.8285', 'Bangka', 5, 'saat listing ada 6 art, ternyata senin malam 3 art pindah ke pangkalpinang untuk menetap. sehingga hanya mencacah 3ruta yg menetap skrg. apakah diperbolehkan?', 'Cacah 3 ART yang ada sekarang', 'khusus', '2017-02-28 04:39:52'),
(488, '14.8060', '14.8060', 'Bangka', 5, 'responden menolak diwawancarai, udah bawa SLS, pakai PDA, bahkan nunjukin surat pun tetap nolak. Itu gimana? boleh nonres? udah 5 kali revisit. bahkan udah bawa 1 tim', 'lanjutkan ke ruta yang lain dulu\r\nsambil berdoa supaya tidak nonrespons\r\n\r\ndirevisit paling akhir\r\ncoba ganti pencacah (pcl atau kortim yang bisa cepat beradaptasi dan komunikasi dengan bahasa bangka)', 'umum', '2017-02-28 06:09:04'),
(489, '14.8243', '14.8267', 'Bangka', 1, 'kalo kerjanya serabutan itu masuk kategori mana?', '', 'khusus', '2017-02-28 09:52:55'),
(493, '14.7938', '14.8168', 'Bangka', 5, 'kalo rumah tingkat 2 hitung luasnya gmna ?', '', 'khusus', '2017-02-28 09:10:51'),
(497, '14.8126', '14.8126', 'Bangka', 5, 'ini ada kasus dia melaut bulan ini tu dapetnya cuma sedikit karena musim jelek dan jadinya pengluaran > pndapatan, tpi pendapatan biasanya tu dia bisa dapet banyak dan kalo pake yang biasanya ini pndepatan > pengeluaran jdi how?', 'tanya pendapatan setahun yang lalu kemudian dibagi 12 ditambah dengan pendapatan bulan ini. begitu pula biaya produksinya, berapa biaya produksi tahun lalu dibagi 12 (atau dekati dengan biaya produksi 1 bulan) ditambah dengan biaya produksi bulan ini', 'khusus', '2017-02-28 08:28:53'),
(499, '14.8126', '14.8126', 'Bangka', 5, 'kalo bayar pinjaman ke bank masuknya di pengeluaran yang apa ya? kalo menganggur kegiatan sminggu yang lalu masuknya apa?', 'tidak tercakup di pengeluaran\r\ntetapi catat aja di blok catatan seberapa yang dibayarkan.\r\n\r\nsementara gak tidak bekerja.. (pertanyaan kedua)', 'khusus', '2017-02-28 11:01:38'),
(503, '14.8310', '14.8310', 'Bangka', 5, 'Kalau ada ruta yg punya kebun (+-udah 3 tahun), dan dia dari awal beli tanah, harga beli tanah di input atau tidak? kalau iya, di input dimana? modal?', 'untuk blok ketenagakerjaan, pada modal awal usaha lahan dan tanah tidak diimput', 'khusus', '2017-02-28 12:38:28'),
(504, '14.8344', '14.7981', 'Bangka', 6, 'udah kelar sinar manik. udah kelar 4 ruta. hp belum kelar ini mau otewe penginapan', 'tapi kunci di aku yud wkwk', 'khusus', '2017-12-22 03:07:30'),
(505, '14.8310', '14.8310', 'Bangka', 3, 'Apa yg terjadi kalau PCL mengubah salah 1 no ruta kuesioner tetapi nomor ruta tsb ternyata sudah ada di tab PCL, nah, kuesioner yg lama hilang, itu tertindih gitu ya?', 'Merubah untuk apa? Jika ada kesalahan pengisian dan sudah dikirim maka kortim dapat mengembalikan untuk diperbaiki', 'khusus', '2017-02-28 13:42:56'),
(506, '14.7981', '14.7981', 'Bangka', 5, '1. responden nenek2 tinggal sendiri, punya masalah pendengaran. sepertinya tidak memungkinkan utk dicacah, bagaimana?', 'Tetap harus dicacah. Bisa meminta tolong  pada tetangga atau warga sekitar', 'khusus', '2017-03-01 03:09:42'),
(507, '14.8310', '14.8310', 'Bangka', 5, 'Responden mengaku memiliki jaminan kesehatan BPJS, tetapi tidak mengeluarkan iuran sama sekali (tidak ada tarikan juga), nah itu tetap input BPJS atau JAMKESMAS(Buped), jadi di isi BPJS atau JAMKESMAS?', 'Izin menjawab, sekarang JAMKESMAS sudah tidak ada, sudah digantikan namanya dengan BPJS. BPJS yang tidak bayar sama sekali dan untuk masyarakat kalangan ke bawah itu sekarang ikut PBI. Yang dulunya ASKES sekarang masuk ke PPU', 'khusus', '2017-03-01 01:20:13'),
(508, '14.8432', '14.8432', 'Bangka', 5, 'Ada responden yang benar-benar ga mau jawab salah satu pertanyaan. diisikan apa ya? di blok 15C', 'Tanyakan persepsi saja, biarkan responden memilih saja. Dekati responden dengan hati, pelan pelan saja. Buat suasana senyaman mungkin seperti responden yang bercerita tentang kehidupannya ^^', 'khusus', '2017-03-01 03:16:28'),
(509, '14.8391', '14.8130', 'Bangka', 5, 'jika panen dalam jangka waktu 3 tahun sekali bagaimana input produksi pada usaha apakah harus dibagi 36 bulan?', '', 'khusus', '2017-02-28 16:32:11'),
(510, '14.8391', '14.8130', 'Bangka', 5, 'jika panen dalam jangka waktu 3 tahun sekali bagaimana input produksi pada usaha apakah harus dibagi 36 bulan?', '', 'khusus', '2017-02-28 16:32:14'),
(511, '14.8391', '14.8130', 'Bangka', 5, 'sayuran dari hasil kebun sendiri tapi tidak dibudidaya diinput pada bagian mana dalam capi? karena mempengaruhi nilai pendapatan dan pengeluaran rumah tangga sehingga pengeluaran lebih besar dari pendapatan', '', 'khusus', '2017-02-28 16:35:02'),
(512, '14.8001', '14.8092', 'Bangka', 3, 'kalo di cek error gak ada yang tanda merah tapi pas mau simpan ada tulisan found 7 error . itu gimana ya ?', '', 'khusus', '2017-02-28 17:01:55'),
(519, '14.8066', '14.8103', 'Bangka', 6, 'kalo ada non respon bagaimana solusinya? apakah ada penggantian sampel? atau dibiarkan saja? ', '', 'khusus', '2017-12-22 03:07:30'),
(520, '14.8006', '14.8006', 'Bangka', 5, 'kalau rumah cm 1 petak, dan semuanya dilakukan disana makan tidur dll, jadi ruangan itu dianggap kamar apa engga? soalnya kalo 0 ga lewat rule validasi capi. anggap 1 ya?', 'Dianggap satu kamar', 'khusus', '2017-03-01 02:46:05'),
(521, '14.8344', '14.7981', 'Bangka', 6, 'tanyaaaa', 'dmna yud? aku sama eka di kantor desa sinar manik', 'khusus', '2017-12-22 03:07:30'),
(527, '14.8427', '14.8427', 'Bangka', 5, 'apabila ada responden yg benar2 menolak hanya bisa via telepon, apakah boleh diwawancara via telepon?', 'Tidak boleh. Untuk pencacahan pertama, diusahakan untuk mewawancarai secara langsung. Namun jika ada beberapa data yang perlu dikonfirmasi, bisa lewat telepon.', 'khusus', '2017-03-01 03:10:55'),
