(533, '14.8427', '14.8427', 'Bangka', 3, 'pcl : 14.8038. blok 11b sampel sdh terkirim, dikortim tampilannya tadi jg sdh terkirim (dulu masalah sync yg bermasalah) nah tp krn tadi tiba2 ke close,trus coba di sync kan bs,tp tampilan malah jd kembali selesai listing(blm diambil sampel)', 'dulu ambil sampelnya offline / online wid ?,  yang ngambil pake akun kortim / pcl ?\r\ncoba di sync dulu, kalo masih gak bisa, di device yg dipake pas ambil sampel kirim file2 di folder penyimpanan  internal -> CAPI56 -> SaMS -> NIM yang ambil sampel \r\nmungkin bisa pc aja wid', 'khusus', '2017-03-01 04:57:47'),
