(536, '14.8178', '14.8178', 'Bangka', 5, 'untuk responden yg pindah tempat , sedang sakit (rumahnya kosong), itu nanti dikues nya dipilih "tidak dapat diwawancarai" ?', 'Jika sampai hari ini tidak ada bisa diisi "tidak dapat diwawancarai" tetapi harus mengisi surat berita acara\r\nUntuk kasus org yg benar2 tidak ada ditempat bisa ditandatangani oleh ketua RT nya', 'khusus', '2017-03-02 02:18:09'),
(537, '14.8427', '14.8427', 'Bangka', 3, 'pd halaman total pengeluaran non makanan terdapat rincian rata2 perbulan makanan non makanan dan pengeluaran ruta. tapi di rekapitulasi tidak muncul pengeluaran non makanan dan pengeluaran ruta. kenapa ya?', 'udah pake kuesioner terbaru, yg VKD.PKL56.RT ver1', 'khusus', '2017-03-02 02:54:48'),
(538, '14.8427', '14.8427', 'Bangka', 3, 'sudah memakai kuesioner terbaru, masih sama tampilannya di rekapitulasi tidak muncul pengeluaran non makanan dan pengeluaran ruta. pdahal di halaman sebelumnya muncul', '', 'khusus', '2017-03-02 03:29:18'),
