(544, '14.7978', '14.8060', 'Bangka', 6, 'jika dlm satu rumag tangga,  ada ibu, anak dan keponakan.  namun saat di tanya pendapatan keponakannya, respondennya gk tahu,  sudah diminta untuk diperkirakan tp katanya tidak pernah ditanyakan. jdnya gimana? pekerjaanya karyawan ditoko ', '', 'khusus', '2017-12-22 03:06:37'),
